export const createEvents = (data) => {
  console.log("data", data);
  const url = `https://rocky-wave-71489.herokuapp.com/student`;
  return fetch(url, {
    method: "POST",
    headers: {
      Accept: "application/json",
      "Content-Type": "application/json",
    },
    body: JSON.stringify(data),
  })
    .then((data) => {
      return data.json();
    })
    .catch((error) => {
      throw error;
    });
};

export const getAllEvents = () => {
  const url = `https://rocky-wave-71489.herokuapp.com/event`;
  return fetch(url, {
    method: "GET",
    headers: {
      Accept: "application/json",
      "Content-Type": "application/json",
    },
  })
    .then((data) => {
      //   console.log("data", data);
      return data.json();
    })
    .catch((error) => {
      throw error;
    });
};
